    "2013-12-07T09:04:16.343971",nt"name": "bismarck-mandan-topographic-two-foot-contours-2005",nt"isopen":
    false,nt"url": null,nt"notes": "Horizons, Inc. was contracted by the Bismarck-Mandan
    Metropolitan Planning Organization to provide accurate 6" pixel resolution color
    digital orthophotography, update 2 1/2 sections of existing 2' contour data and
    collect new DTM data for the generation on 2' contours on 39 new sections. The project
    encompassed an area of approximately 197 square miles. The existing DTM data which
    Horizons had collected in 2001 was updated to support 2' contours where requested.
    New mapping was performed on 40 sections and an additional 30 sections of DTM collection
    was done for ortho rectification only. Contour were generated from the updated and
    new DTM data and delivered in ARC Shape file format in one contiguous file. The
    DTM data including breaklines, random points and spot elevation points were also
    delivered in ARC Shape file format.",nt"license_title": null,nt"extras":
